import React from 'react';
import './ServicesPage.css';

const ServicesPage = () => (
    <div className="services">
        <header className="services-hero">
            <h1>Our Services</h1>
            <p>Explore the range of services we offer</p>
        </header>
    </div>
);

export default ServicesPage;
